import React from 'react'
import Home from './Home'
import TicketList from './TicketList';


class App extends React.Component{

	render () {

		const [show, toggleShow] = useState(true);

		return	(
			<div>
				<Home />
				<TicketList />
			</div>
		)
	}
}

export default App
